     if (left_l_dir&right_l_dir) { type = 1; scan_mode = 1;return; }//遇到直角或弯道，向增大偏
     else if (!(left_l_dir || right_l_dir)) { type = 2;scan_mode = 1; return; }//遇到直角或弯道，向减小偏
