#define Dark_defien_max  30
#define Dark_defien_min  15
uint8 identify_angle()//是直角返回1
 {
     uint16 check_lie,check_1,check_2;
     uint16 check_1_flag=0,check_2_flag=0,identify=0;
     uint16 i,j,timess=0;
     if(angle_type!=0)
      {
          if(type==1)
           {
               if(left_line[change_left_dot-1][1]<Y_MAX-20)
                   check_lie=left_line[change_left_dot-1][1]+10;
               else return 1;
               for(j=check_lie;j<Y_MAX-5;j+=2)
                {  
                    check_1_flag=0;check_2_flag=0;
                    for(i=5;i<X_MAX-5;i++)
                     {
                         if((!check_1_flag)&&(date[i][j]>threshold_left)&&(date[i+1][j]<threshold_left)&&(date[i+2][j]<threshold_left))
                          {
                              check_1_flag=1;check_1=RST0[i*Y_MAX+j];timess++;
                          }
                         if((check_1_flag)&&(date[i][j]>threshold_left)&&(date[i-1][j]<threshold_left)&&(date[i-2][j]<threshold_left))
                          {
                              check_2_flag=1;check_2=RST0[i*Y_MAX+j];
                              break;
                          }
                     }
                    if((check_2_flag)&&(check_2<check_1+Dark_defien_max)&&(check_2>check_1+Dark_defien_min)) identify++;
                }
               if(identify>timess/2) return 0;//表示不是直角
               else return 1;//直角
           }
          if(type==2)
           {
               if(right_line[change_right_dot-1][1]>20)
                   check_lie=right_line[change_right_dot-1][1]-10;
               else return 1;
               for(j=check_lie;j>5;j-=2)
                {
                    
                    check_1_flag=0;check_2_flag=0;
                    for(i=5;i<X_MAX-5;i++)
                     {
                         if((!check_1_flag)&&(date[i][j]>threshold_right)&&(date[i+1][j]<threshold_right)&&(date[i+2][j]<threshold_right))
                          {
                              check_1_flag=1;check_1=RST0[i*Y_MAX+j]; timess++;
                          }
                         if((check_1_flag)&&(date[i][j]>threshold_right)&&(date[i-1][j]<threshold_right)&&(date[i-2][j]<threshold_right))
                          {
                              check_2_flag=1;check_2=RST0[i*Y_MAX+j];
                              break;
                          }
                     }
                    if((check_2_flag)&&(check_2<check_1+Dark_defien_max)&&(check_2>check_1+Dark_defien_min)) identify++;
                }
               if(identify>timess/2) return 0;
               else return 1;
           }
      }
 }
